import React from "react";

const Result = ({compressArray, results}) => {
    return (
        <div className="resultContainer">
            <div className="disclaimer">
                hello
            </div>
            <div className="results">
            <ul id="jobsResults"> 
                        {compressArray(results).map(function(item, index) {
                        if(index === 0 || index === 1 || index === 2) {
                           return <li key={index} id="mostlikelyjob"> {item.value} </li>
                        } else if(index === results.length - 1 || index === results.length - 2|| index === results.length - 3) {
                            return <li key={index} id="leastlikelyjob"> {item.value} </li>
                        } else {
                            return <li key={index}> {item.value} </li>
                        }
                })}
                </ul>
            </div>
        </div>
        // <div className="resultContainer">
        //     <div className="disclaimer">
        //         <p>Based on your skills, the following job titles are sorted from most appropriate for you in descending order. Start your job search with these job titles. Good Luck!</p>
        //     </div>
        //     <div className="results">

        //     </div> 
        // </div>
    )
}

export default Result;
